'''
You are given an array nums consisting of non-negative integers. You are also given a queries array, where queries[i] = [xi, mi].

The answer to the ith query is the maximum bitwise XOR value of xi and any element of nums that does not exceed mi. In other words, the answer is max(nums[j] XOR xi) for all j such that nums[j] <= mi. If all elements in nums are larger than mi, then the answer is -1.

Return an integer array answer where answer.length == queries.length and answer[i] is the answer to the ith query.

Example 1:
Input: nums = [0,1,2,3,4], queries = [[3,1],[1,3],[5,6]]
Output: [3,3,7]
Explanation:
1) 0 and 1 are the only two integers not greater than 1. 0 XOR 3 = 3 and 1 XOR 3 = 2. The larger of the two is 3.
2) 1 XOR 2 = 3.
3) 5 XOR 2 = 7.

Example 2:
Input: nums = [5,2,4,6,6,3], queries = [[12,4],[8,1],[6,3]]
Output: [15,-1,5]

Constraints:
1 <= nums.length, queries.length <= 105
queries[i].length == 2
0 <= nums[j], xi, mi <= 109
'''
class Node:
    def __init__(self):
        self.left = None
        self.right = None

class Solution:
    def buildTree(self, nums):
        self.root = Node()
        for num in nums:
            exp = 30
            cur_n = self.root
            while exp >= 0:
                #print(num, exp)
                if num >= 1 << exp:
                    if cur_n.right == None:
                        new_n = Node()
                        cur_n.right = new_n
                    cur_n = cur_n.right
                    num -= 1 << exp
                else:
                    if cur_n.left == None:
                        #print('left is None')
                        new_n = Node()
                        cur_n.left = new_n
                    cur_n = cur_n.left
                exp -= 1

    def search(self, val, cur_n, exp, limit, cur_num):
        self.ct+=1
        if cur_n is None or cur_num > limit:
            return -1
        # print(val,exp,limit,cur_num)
        if exp < 0:
            return -1 if cur_num > limit else cur_num
        is_one = val & (1 << exp) > 0
        if limit >= 1 << exp and ((not is_one and cur_n.right != None) or cur_n.left == None):
            try_set_one = self.search(val, cur_n.right, exp-1, limit, cur_num + (1 << exp))
            if try_set_one > 0:
                return try_set_one
        return self.search(val, cur_n.left, exp-1, limit, cur_num)

    def maximizeXor(self, nums, queries):
        print(len(nums), len(queries))
        # nums=list(set(nums))
        self.buildTree(nums)
        print('finished building tree')
        res = []
        for i,(x,m) in enumerate(queries):
            self.ct = 0
            val = self.search(x, self.root, 30, m, 0)
            print(i, self.ct)
            if val < 0:
                res.append(val)
            else:
                res.append(x^val)
        return res

